THREDDS catalog&amp;lt;a /&amp;gt; (GEPS_latest.ncml)"},"id":"12311","type":"panel.models.markup.HTML"},{"attributes":{"args":{"plot":{"id":"12112"}},"code":"var data = {};\ndata[\"height\"] = cb_obj[\"inner_height\"];\ndata[\"width\"] = cb_obj[\"inner_width\"];\n\nfunction unique_events(events) {\n  // Processes the event queue ignoring duplicate events\n  // of the same type\n  var unique = [];\n  var unique_events = [];\n  for (var i=0; i&lt;events.length; i++) {\n    var _tmpevent = events[i];\n    event = _tmpevent[0];\n    data = _tmpevent[1];\n    if (unique_events.indexOf(event)===-1) {\n      unique.unshift(data);\n      unique_events.push(event);\n      }\n  }\n  return unique;\n}\n\nfunction process_events(comm_status) {\n  // Iterates over event queue and sends events via Comm\n  var events = unique_events(comm_status.event_buffer);\n  for (var i=0; i&lt;events.length; i++) {\n    var data = events[i];\n    var comm = window.PyViz.comms[data[\"comm_id\"]];\n    comm.send(data);\n  }\n  comm_status.event_buffer = [];\n}\n\nfunction on_msg(msg) {\n  // Receives acknowledgement from Python, processing event\n  // and unblocking Comm if event queue empty\n  var metadata = msg.metadata;\n  var comm_id = metadata.comm_id\n  var comm_status = window.PyViz.comm_status[comm_id];\n  if (comm_status.event_buffer.length) {\n    process_events(comm_status);\n    comm_status.blocked = true;\n    comm_status.time = Date.now()+20;\n  } else {\n    comm_status.blocked = false;\n  }\n  comm_status.event_buffer = [];\n  if ((metadata.msg_type == \"Ready\") &amp;&amp; metadata.content) {\n    console.log(\"Python callback returned following output:\", metadata.content);\n  } else if (metadata.msg_type == \"Error\") {\n    console.log(\"Python failed with the following traceback:\", metadata.traceback)\n  }\n}\n\n// Initialize Comm\nif ((window.PyViz == undefined) || (window.PyViz.comm_manager == undefined)) { return }\nvar comm = window.PyViz.comm_manager.get_client_comm(\"12099\", \"76bfc6969b8c42d6ac0163caae6fdb2d\", on_msg);\nif (!comm) {\n  return\n}\n\n// Initialize event queue and timeouts for Comm\nvar comm_status = window.PyViz.comm_status[\"76bfc6969b8c42d6ac0163caae6fdb2d\"];\nif (comm_status === undefined) {\n  comm_status = {event_buffer: [], blocked: false, time: Date.now()}\n  window.PyViz.comm_status[\"76bfc6969b8c42d6ac0163caae6fdb2d\"] = comm_status\n}\n\n// Add current event to queue and process queue if not blocked\nvar event_name = cb_obj.event_name;\nif (event_name === undefined) {\n  // we are a widget not an event... fake a key.\n  event_name = Object.keys(data).join(',');\n}\ndata['comm_id'] = \"76bfc6969b8c42d6ac0163caae6fdb2d\";\nvar timeout = comm_status.time + 20000;\nif ((comm_status.blocked &amp;&amp; (Date.now() &lt; timeout))) {\n  comm_status.event_buffer.unshift([event_name, data]);\n} else {\n  comm_status.event_buffer.unshift([event_name, data]);\n  setTimeout(function() { process_events(comm_status); }, 20);\n  comm_status.blocked = true;\n  comm_status.time = Date.now()+20;\n}\n"},"id":"12164","type":"CustomJS"},{"attributes":{"margin":[5,5,5,5],"name":"HTML34744","sizing_mode":"stretch_width","text":"https://weather.gc.ca/grib/grib2_ens_geps_e.html"},"id":"12328","type":"panel.models.markup.HTML"},{"attributes":{"data_source":{"id":"12167"},"glyph":{"id":"12170"},"hover_glyph":null,"muted_glyph":{"id":"12172"},"nonselection_glyph":{"id":"12171"},"selection_glyph":{"id":"12175"},"view":{"id":"12174"}},"id":"12173","type":"GlyphRenderer"},{"attributes":{"margin":[5,5,5,5],"name":"HTML34738","sizing_mode":"stretch_width","text":"Global ensemble forecasts are made twice a day using the canadian GEM model to generate potential weather scenarios up to 16 days. 20 &amp;#x27;perturbed&amp;#x27; weather forecasts are performed. The 20 models have different physics parametrizations, data assimilation cycles and sets of perturbed observations"},"id":"12325","type":"panel.models.markup.HTML"},{"attributes":{
